    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'>¿Que se
    destaca de Asia?<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal><span style='font-size:14.0pt;line-height:105%;
    mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin'>Asia es el
    continente más grande y el que presenta la mayor diversidad de razas,
    culturas y lenguas del mundo. Ocupa una superficie de 44.614.000 kilómetros
    cuadrados, que representa las 4/5 partes de la masa continental de Eurasia
    y que equivale a 1/3 de la superficie terrestre total.<o:p></o:p></span></p>
